### 请提出你的问题

predict的过程中会出现同一个实体属于多个实体类型的问题，该怎么判断实体的类型，已经实体到底属于哪一个类别呢？
示例：
（1）{"content": "爱情公寓》预售票房破亿01:29爱情公寓口碑大跌，恶评如潮…01:07电影版爱情公寓糟起诉?还…", "result_list": [{"text": "爱情公寓》", "start": 0, "end": 5}, {"text": "爱情公寓", "start": 16, "end": 20}, {"text": "爱情公寓", "start": 38, "end": 42}], "prompt": "movie"}
（1）{"content": "爱情公寓》预售票房破亿01:29爱情公寓口碑大跌，恶评如潮…01:07电影版爱情公寓糟起诉?还…", "result_list": [{"text": "爱情公寓》", "start": 0, "end": 5}, {"text": "爱情公寓", "start": 16, "end": 20}, {"text": "爱情公寓", "start": 38, "end": 42}], "prompt": "organization"}
（2）{"content": "爱情公寓》预售票房破亿01:29爱情公寓口碑大跌，恶评如潮…01:07电影版爱情公寓糟起诉?还…", "result_list": [{"text": "爱情公寓》", "start": 0, "end": 5}, {"text": "爱情公寓", "start": 16, "end": 20}, {"text": "爱情公寓", "start": 38, "end": 42}], "prompt": "name"}

将prompt设置为"movie"、"organization"、 "name"、“xxx”，都能识别到实体“爱情公寓”，那么实体“爱情公寓”到底属于哪个类别呢？
